import React from "react";

const NavPart = () => {

return(
	<div class = "d-flex">
		<div>
		<button class="btn btn-outline-success my-2 my-sm-0" type="submit">VOBB</button>
		</div>
		<div>
			<form class="form-inline">
			<input class="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search"/>
      		<button class="btn btn-outline-success my-2 my-sm-0" type="submit">Search by Title, Author or ISBN</button>
    		</form>
		</div>
		<div>
      		<button class="btn btn-outline-success my-2 my-sm-0" type="submit">Hi, Sign in</button>
			<i class="bi bi-search"></i>
		</div>
	</div>
	);
}

export default NavPart;
